const title = `Auto actions`;
const content = "\"---\\nsidebar_position: 6\\ntitle: Auto actions\\n---\\n# Auto actions\\n\\nimport ReduckTip from \\\"@site-docs/components/reduck-tip\\\"\\n\\n<ReduckTip />\\n\\nReduck 可以根据 State 的类型，自动生成相应的 Actions，为修改 State 提供便利。\\n\\n:::tip 提示\\n可通过 [`runtime.state.autoActions`](/configure/app/runtime/state#autoactions) 关闭 auto actions 功能。\\n\\n:::\\n\\n## 示例\\n\\n### 基础数据类型\\n\\nState 类型为 `string`、`number`、`boolean`、`null` 时，生成 `setState` Action。\\n\\n```tsx title=\\\"示例\\\"\\nconst fooModel = model('foo').define({\\n  state: 1,\\n});\\n\\nfunction App() {\\n  const [state, actions] = useModel(fooModel);\\n\\n  return (\\n    <div>\\n      <div>State: {state}</div>\\n      <button\\n        type=\\\"button\\\"\\n        onClick={() => {\\n          // 调用自动生成的 setState Action\\n          actions.setState(state + 1);\\n        }}\\n      >\\n        add\\n      </button>\\n    </div>\\n  );\\n}\\n```\\n\\n### 数组 Array\\n\\nState 类型为 Array 时，生成下列 Actions：\\n\\n- `push`：将一个或多个元素添加到数组的末尾。\\n- `pop`：从数组中删除最后一个元素。\\n- `shift`：从数组中删除第一个元素。\\n- `unshift`：将一个或多个元素添加到数组的开头。\\n  - 语法：`arr.unshift(element1, ..., elementN)`\\n  - `elementN`：要添加到数组开头的元素或多个元素。\\n- `filter`：过滤元素。\\n{/* 语义与原生方法不同，待修改 API  */}\\n- `concat`：拼接数组。\\n{/* 语义与原生方法不同，待修改 API  */}\\n- `splice`：通过删除或替换现有元素或者原地添加新的元素来修改数组，并以数组形式返回修改后的数组（注意和原生 `splice` 返回值不同）。\\n  - 语法：`splice(start[, deleteCount[, item1[, item2[, ...]]]])`\\n  - `start`：指定修改的开始位置（从 0 计数）。\\n  - `deleteCount`：可选，整数，表示要移除的数组元素的个数。\\n  - `item, item2, ...`：可选，要添加进数组的元素，从 start 位置开始。如果不指定，则 `splice` 将只删除数组元素。\\n\\n```tsx title=\\\"示例\\\"\\nconst fooModel = model('foo').define({\\n  state: [1, 2, 3],\\n});\\n\\nfunction App() {\\n  const [state, actions] = useModel(fooModel);\\n\\n  useEffect(() => {\\n    actions.push(4);\\n    actions.pop();\\n    actions.shift(0);\\n    actions.unshift();\\n    actions.filter(val => val <= 2);\\n    actions.splice(0, 1, 1, 2);\\n  }, []);\\n\\n  return (\\n    <div>\\n      <div>State: {state}</div>\\n    </div>\\n  );\\n}\\n```\\n\\n### 简单对象 PlainObject\\n\\nState 类型为 PlainObject 时，根据 State 包含的属性名，生成 `set${key}`（小驼峰命名）Actions。\\n\\n```tsx title=\\\"示例\\\"\\nconst fooModel = model('foo').define({\\n  state: {\\n    a: 1,\\n    b: { value: 1 },\\n    c: 'c',\\n  },\\n});\\n\\nfunction App() {\\n  const [state, actions] = useModel(fooModel);\\n\\n  useEffect(() => {\\n    actions.setA(2);\\n    actions.setB({ value: 2 });\\n    actions.setC('d');\\n  }, []);\\n\\n  return (\\n    <div>\\n      <div>State: {state}</div>\\n    </div>\\n  );\\n}\\n```\\n\"";
